            </Head>

            <h1>Teste</h1>
{/* 
            <Router>
                <Switch>
                    <Route path="/home" component={Home}>Home</Route>
                    <Route path="/sobre" component={Sobre}>Sobre</Route>
                </Switch>
            </Router> */}
        </>
    );
}

export default App;
